import React from 'react';
import '../css/Post.css'
import Card from './Post Animation'


class Post extends React.Component {
    constructor(){
        super()
        this.state = {
            verified : false
        }
    }

    render(){
        return(
            <Card></Card>
        )
    }
}


export default Post
